INSERT INTO `products` (`id`, `name`, `slug`, `category_id`, `description`, `price`, `content`, `avatar`, `total_vote`, `stat_vote`, `age_vote`, `created_at`, `updated_at`) VALUES (1, 'sữa chua và yến mạch', 'sua-chua-va-yen-mach', 7, 'gày nay rất nhiều người quan tâm đến sức khỏe và vóc dáng cơ thể. Ngoài tập thể dục thể thao thì một chế độ ăn Healthy là sự lựa chọn của nhiều người.', 100000, '<p>M&ocirc; tả sản phẩm sản phẩm tuyệt vờig&agrave;y nay rất nhiều người quan t&acirc;m đến sức khỏe v&agrave; v&oacute;c d&aacute;ng cơ thể. Ngo&agrave;i tập thể dục thể thao th&igrave; một chế độ ăn Healthy l&agrave; sự lựa chọn của nhiều người.&nbsp;g&agrave;y nay rất nhiều người quan t&acirc;m đến sức khỏe v&agrave; v&oacute;c d&aacute;ng cơ thể. Ngo&agrave;i tập thể dục thể thao th&igrave; một chế độ ăn Healthy l&agrave; sự lựa chọn của nhiều người.&nbsp;g&agrave;y nay rất nhiều người quan t&acirc;m đến sức khỏe v&agrave; v&oacute;c d&aacute;ng cơ thể. Ngo&agrave;i tập thể dục thể thao th&igrave; một chế độ ăn Healthy l&agrave; sự lựa chọn của nhiều người.&nbsp;</p>\r\n\r\n<div class=\"ddict_div\" style=\"left:168.287px; max-width:150px; top:42.6px\"><img class=\"ddict_audio\" src=\"chrome-extension://bpggmmljdiliancllaapiggllnkbjocb/img/audio.png\" />\r\n<p class=\"ddict_sentence\">kh&ocirc;ng</p>\r\n</div>', '2023-04-13__sua-chua-va-yen-mach.png', 2, 9, 0, '2023-04-12 22:59:16', '2023-07-17 15:23:36');
